import React from "react";

const Home = () => {
  return (
    <div className="h-screen bg-gradient-to-br from-green-500 to-blue-300">
      <div className="home">
        <div className="home-details">
          <p>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Animi
            deleniti, eveniet ea dolorum corporis enim delectus nulla eius
            aliquid maiores libero est earum nihil, minus sit, alias nisi
            officiis expedita.
          </p>
        </div>
        <div className="home-image"></div>
      </div>
    </div>
  );
};

export default Home;
